  false,\n\t\"url\": null,\n\t\"notes\": \"Data points represent head scarps, flank
  scarps, and minor internal scarps (linear) associated with landslide deposits in
  the Little North Santiam River Basin, Oregon. This work was completed as part of
  the Master's thesis \"Turbidity Monitoring and LiDAR Imagery Indicate Landslides
  are Primary Source of Suspended-Sediment Load in the Little North Santiam River
  Basin, Oregon, Winter 2009-2010\" by Steven Sobieszczyk, Portland State University
  and U.S. Geological Survey. Data layers in this geodatabase include: landslide deposit
  boundaries (Deposits); field-verfied location imagery (Photos); head scarp or scarp
  flanks (Scarp_Flanks); and secondary scarp features (Scarps).The geodatabase template
  was developed by the Oregon Department of Geology and Mineral Industries (Burns
  and Madin, 2009).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
